import "./style.css";
import {useHistory} from "react-router-dom";


const StarPage = (props) => {

    const history = useHistory();


    return (
        <div>

            <h3><span className="day">{props.name}</span> 평점 남기기</h3>

            <div className="circle-list">
                <div className="as" id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
            </div>

            <button className="btn" onClick={() => {
                history.push("./")
            }}>평점 남기기</button>

        </div>
    );
}


